import React from 'react';//this by default imported in every file in modern react though we can also add it manually.
//out jsx use tis import for its work.
import './NewExpense.css'
import ExpenseForm from './ExpenseForm'
const NewExpense=(props)=>{
    const saveExpenseDataHandler=(enteredExpenseData)=>{
        const expenseDataBody= {
            ...enteredExpenseData,
            id: Math.random().toString()
           
        }
        props.onAddData(expenseDataBody)
    }
    
    
    return <div className='new-expense'>
     <ExpenseForm onSaveExpenseData={saveExpenseDataHandler}></ExpenseForm>
    </div>
}
export default NewExpense
